!function($){$.fn.shuffle=function(){return this.each(function(){var n=$(this).children().clone(!0);return n.length?$(this).html($.shuffle(n)):this})},$.shuffle=function(n){for(var t,e,h=n.length;h;t=parseInt(Math.random()*h),e=n[--h],n[h]=n[t],n[t]=e);return n}}(jQuery);